import React from "react";
import { reduxForm, Field } from "redux-form";
import { Input } from "antd";

let LoginForm = () => {
  // console.log("govno");

  return (
    <form>
      <div>
        <label> Name </label>
        <Field name="firstName" component="input" />
      </div>
    </form>
  );
};

LoginForm = reduxForm({
  form: "login"
})(LoginForm);

export default LoginForm;
